import React, { useState } from "react";
import TableList from "./TableList";
import { loadContributors } from "./../logic/contributorsActions";

function Dashboard() {
  const [contributorsList, setContributorsList] = useState(null);
  const [error, setError] = useState(null);

  console.log("there is the contributors in DASHBOARD", contributorsList);

  return (
    <>
      <h1>Contributors List</h1>
      <input placeholder="Repository name"></input>
      <button
        onClick={(event) => {
          event.preventDefault();
          setContributorsList([]);
          loadContributors().then(setContributorsList).catch(setError);
        }}
      >
        Get collab!
      </button>
      <TableList contributorsList={contributorsList} error={error} />
    </>
  );
}

export default Dashboard;
